import React from "react";
import { Box, Typography, Link, Divider } from "@mui/material";

const Header = () => {
  return (
    <Box
      sx={{
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: 'black'
      }}
      align='center'
    >

    </Box>
  );
};

export default Header;
